import FetchBands from "./components/FetchBands";
import Input from "./components/Input";


class App extends Component {
  state = {
    location:
      {
        name: 'nashville,tennessee'
      }

}

  render() {
    console.log("locationState:", this.state.location.name)
    return (
      <div className="App">
        <FetchBands />
        <form>
          <Input location={this.state.location.name}/>
        </form>
      </div>
    );
  }
}

export default App;
